import React, { setState, useCallback } from "react";
import "./VideoPlayer.css";

const VideoPlayer = ({ playback }) => {

    const exampleVideo = "Djrl6fu8myo";

    (document).ready(function() {
        ('#PlayButton').on('click', function(e) {
            ("Video")[0].src += "&autoplay=1";
            e.preventDefault();
        })
    })

    /*
    const play = useCallback(() => {
        
    }, []);
    */


    return (
        <div id="VideoControls">
            <iframe id="Video" width="960" height="540" controls="0" src={"https://www.youtube.com/embed/" + exampleVideo + `?enablejsapi=1&showinfo=0&controls=0&rel=0`} allow="autoplay"></iframe>
            <button id="PlayButton" className="text"></button>
        </div>
    )
}

export default VideoPlayer;
